// ===================== Forecast.jsx =====================
import React, { useEffect, useState } from 'react';
import axios from 'axios';
import {
  Card,
  CardContent,
  Typography,
  CircularProgress,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper
} from '@mui/material';
import {
  LineChart,
  Line,
  XAxis,
  YAxis,
  Tooltip,
  CartesianGrid,
  ResponsiveContainer
} from 'recharts';

function Forecast() {
  const [forecast, setForecast] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  const API_URL = 'http://127.0.0.1:8000/forecast/';

  useEffect(() => {
    axios
      .get(API_URL)
      .then((res) => {
        setForecast(res.data);
        setLoading(false);
      })
      .catch((err) => {
        setError(err.message);
        setLoading(false);
      });
  }, []);

  if (loading)
    return (
      <div style={{ textAlign: 'center', padding: '20px' }}>
        <CircularProgress />
        <Typography variant="body1" sx={{ mt: 2 }}>
          Loading forecast...
        </Typography>
      </div>
    );

  if (error)
    return (
      <Typography variant="h6" color="error" sx={{ textAlign: 'center' }}>
        Error fetching forecast: {error}
      </Typography>
    );

  return (
    <Card elevation={4} sx={{ borderRadius: 4 }}>
      <CardContent>
        <Typography variant="h5" fontWeight={600} gutterBottom>
          Region: {forecast.region}
        </Typography>
        <Typography variant="body2" color="text.secondary">
          Generated at: {new Date(forecast.generated_at).toLocaleString()}
        </Typography>
        <Typography variant="caption" display="block" sx={{ mt: 1 }}>
          SHA256: <code>{forecast.sha256}</code>
        </Typography>

        {/* Chart Section */}
        <Typography variant="h6" fontWeight={600} sx={{ mt: 3 }}>
          7-Day Forecast Trend
        </Typography>

        <div style={{ width: '100%', height: 300 }}>
          <ResponsiveContainer>
            <LineChart data={forecast.forecast}>
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis dataKey="date" />
              <YAxis />
              <Tooltip />
              <Line type="monotone" dataKey="yhat" stroke="#1976d2" strokeWidth={3} />
            </LineChart>
          </ResponsiveContainer>
        </div>

        {/* Forecast Table */}
        <TableContainer component={Paper} sx={{ mt: 3, borderRadius: 3 }}>
          <Table>
            <TableHead>
              <TableRow sx={{ backgroundColor: '#1976d2' }}>
                <TableCell sx={{ color: 'white' }}>Date</TableCell>
                <TableCell sx={{ color: 'white' }}>Predicted Cases</TableCell>
                <TableCell sx={{ color: 'white' }}>Lower Bound</TableCell>
                <TableCell sx={{ color: 'white' }}>Upper Bound</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {forecast.forecast.map((f) => (
                <TableRow key={f.date} hover>
                  <TableCell>{f.date}</TableCell>
                  <TableCell>{f.yhat.toFixed(2)}</TableCell>
                  <TableCell>{f.yhat_lower.toFixed(2)}</TableCell>
                  <TableCell>{f.yhat_upper.toFixed(2)}</TableCell>
                </TableRow>
              ))}
            </TableBody>
          </Table>
        </TableContainer>
      </CardContent>
    </Card>
  );
}

export default Forecast;
